import React, { useState } from "react";
import { Layout, Menu } from "antd";
import {
  UploadOutlined,
  UserOutlined,
  VideoCameraOutlined,
} from "@ant-design/icons";

const AppSidebar = () => {
  const { Sider } = Layout;
  return (
    <div >
      <Sider trigger={null}>
        <div className="demo-logo-vertical" />
        <Menu
         className="fs-6"
         s
          theme="dark"
          mode="inline"
          defaultSelectedKeys={["1"]}
          items={[
            {
              key: "1",
              icon: <UserOutlined />,
              label: "nav 1",
            },
            {
              key: "2",
              icon: <VideoCameraOutlined />,
              label: "nav 2",
            },
            {
              key: "3",
              icon: <UploadOutlined />,
              label: "nav 3",
            },
            {
              key: "4",
              icon: <UploadOutlined />,
              label: "nav 4",
            },
            {
              key: "5",
              icon: <UploadOutlined />,
              label: "nav 5",
            },
            {
              key: "6",
              icon: <UploadOutlined />,
              label: "nav 6",
            },
            {
              key: "7",
              icon: <UploadOutlined />,
              label: "nav 7",
            },
          ]}
        />
      </Sider>
    </div>
  );
};
export default AppSidebar;
